import { NavLink } from "react-router-dom";

const NavLi = (props) => {
  return (
    <li className="nav-item nav-li">
      <NavLink className={({ isActive }) => isActive ? "nav-link " + props.active : "nav-link"} to="/">{props.children}</NavLink>
    </li>
  );
}

export default NavLi;
